import Form from '../components/Form/Form';

function UserPage() {
    const fromTitle = 'User creation form';
    const inputSize = 5;
    let submittedFromData = '';
    const onFormSubmit = (formData) => {
        // console.log('Form data:', formData);
        submittedFromData = formData;
        console.log(submittedFromData);
    };

    return (
        <Form title={fromTitle} size={inputSize} onSubmit={onFormSubmit}/>
    );
}

export default UserPage;
